webpackJsonp([19400682333432],{484:function(i,e){i.exports={data:{markdownRemark:{html:'<p>本文针对使用iPhone或iPad等ios设备进行图书馆自动代理设置，如果是桌面浏览器设置，请参考<a href="/tu-shu-guan-zhuan-yong-chromeliu-lan-qi-xia-zai.html">图书馆专用Chrome浏览器下载</a>。</p>\n<p>设置步骤如下</p>\n<ol>\n<li>连接上<code>YNU-2.4G</code>或<code>YNU-5G</code></li>\n<li>打开系统设置，点击"无线局域网"\n<img src="/images/iphone-pac-0.png"></li>\n<li>点击连接上的<code>YNU-2.4G</code>或<code>YNU-5G</code>右边<code>带圈感叹号</code>按钮进入网络详细设置\n<img src="/images/iphone-pac-1.png"></li>\n<li>在"HTTP 代理"栏目下，点击"配置代理"\n<img src="/images/iphone-pac-2.png"></li>\n<li>选择"自动"，并且在URL栏中输入（最好是复制粘贴）<code>https://raw.githubusercontent.com/liudonghua123/ynu_lib_pac/master/proxy.pac</code>\n<img src="/images/iphone-pac-3.png"></li>\n</ol>\n<p>这样设置之后就可以访问图书馆的数据库资源啦:)</p>\n<p>如果要取消设置，只需要最后配置那里选择"关闭"即可。</p>',fields:{slug:"tu-shu-guan-zi-yuan-xia-zai-zhi-iosxi-tong-she-zhi.html"},frontmatter:{title:"图书馆资源下载之ios系统设置",date:"December 6th 2017",tags:["Chrome","浏览器"]}}},pathContext:{slug:"tu-shu-guan-zi-yuan-xia-zai-zhi-iosxi-tong-she-zhi.html",prev:{fields:{slug:"shen-qing-you-xiang-zhang-hao.html"},frontmatter:{title:"申请邮箱账号",date:"2017-12-06T10:16:10.000Z",tags:["邮箱","申请流程"]}},next:{fields:{slug:"tu-shu-guan-zhuan-yong-chromeliu-lan-qi-xia-zai.html"},frontmatter:{title:"图书馆专用Chrome浏览器下载",date:"2017-12-06T10:16:10.000Z",tags:["Chrome","浏览器"]}}}}}});
